var SVG_IDX2_rightEdge = null;
var SVG_IDX2_SVGHeight = null;
var SVG_IDX2_SVGWidth = null;
function SVG_IDX2_Init(anchor) {
   SVG_IDX2_SVGRoot = document.getElementById(anchor);
   SVG_IDX2_TrueCoords = SVG_IDX2_SVGRoot.createSVGPoint();
   SVG_IDX2_singleTip = document.getElementById(anchor + '_singleTip1');
   SVG_IDX2_singleBox = document.getElementById(anchor + '_singleBox1');
   SVG_IDX2_singleText = document.getElementById(anchor + '_singleText1');
   SVG_IDX2_tiptspan = document.getElementById(anchor + '_tiptspan1');
   SVG_IDX2_tiptspan.firstChild.nodeValue = null;
   SVG_IDX2_SVGRoot.addEventListener('mousemove', SVG_IDX2_ShowTooltip, false);
   SVG_IDX2_SVGRoot.addEventListener('mouseout', SVG_IDX2_HideTooltip, false);
   SVG_IDX2_SVGHeight = SVG_IDX2_SVGRoot.getAttributeNS(null, "height");
   SVG_IDX2_SVGWidth = SVG_IDX2_SVGRoot.getAttributeNS(null, "width");
   if (!isNaN(parseFloat(SVG_IDX2_SVGHeight)) && !isNaN(parseFloat(SVG_IDX2_SVGWidth)))
      SVG_IDX2_GetHW();
}
function SVG_IDX2_GetHW()
{
    if (SVG_IDX2_SVGWidth != null && SVG_IDX2_SVGWidth != "") {
       if (SVG_IDX2_SVGWidth.match(/%/)) {
          var factor = parseFloat(SVG_IDX2_SVGWidth.replace(/%/,""))/100;
          SVG_IDX2_SVGWidth = window.innerWidth * factor;
       }
       else if (SVG_IDX2_SVGWidth.match(/in/))
          SVG_IDX2_SVGWidth = parseFloat(SVG_IDX2_SVGWidth.replace(/in/,""))*96;
       else if (SVG_IDX2_SVGWidth.match(/cm/))
          SVG_IDX2_SVGWidth = parseFloat(SVG_IDX2_SVGWidth.replace(/in/,""))*96/2.54;
       else
           SVG_IDX2_SVGWidth = parseFloat(SVG_IDX2_SVGWidth);
    }
    if (SVG_IDX2_SVGHeight != null && SVG_IDX2_SVGHeight != "") {
       if (SVG_IDX2_SVGHeight.match(/%/)) {
          var factor = parseFloat(SVG_IDX2_SVGHeight.replace(/%/,""))/100;
          SVG_IDX2_SVGHeight = window.innerHeight * factor;
       }
       else if (SVG_IDX2_SVGHeight.match(/in/))
          SVG_IDX2_SVGHeight = parseFloat(SVG_IDX2_SVGHeight.replace(/in/,""))*96;
       else if (SVG_IDX2_SVGHeight.match(/cm/))
          SVG_IDX2_SVGHeight = parseFloat(SVG_IDX2_SVGHeight.replace(/in/,""))*96/2.54;
       else
           SVG_IDX2_SVGHeight = parseFloat(SVG_IDX2_SVGHeight);
    }
}
function SVG_IDX2_GetScaleFactors(evt)
{
   var zoomFactor = 1;
   windowWidth  = (top.innerWidth==undefined)  ? window.innerWidth  : top.innerWidth;
   windowHeight = (top.innerHeight==undefined) ? window.innerHeight : top.innerHeight;
   SVG_IDX2_rightEdge = (SVG_IDX2_SVGWidth) ? SVG_IDX2_SVGWidth - window.pageXOffset : windowWidth;
   if (parseFloat(SVG_IDX2_SVGWidth) > 0 || parseFloat(SVG_IDX2_SVGHeight) > 0)
      var tipScale = 3.125;
   else {
      var tipXScale  = (screen.width/windowWidth) / SVG_IDX2_SVGRoot.currentScale;
      var tipYScale  = (screen.height/windowHeight) / SVG_IDX2_SVGRoot.currentScale;
      var tipScale   = (tipXScale + tipYScale)/2.0;
   }
   SVG_IDX2_attrScale = tipScale;
   if (navigator.appName == 'Adobe SVG Viewer') {
      if (screen.deviceXDPI != null && screen.logicalXDPI != null)
         zoomFactor = screen.deviceXDPI/screen.logicalXDPI;
      SVG_IDX2_attrScale = zoomFactor*tipScale;
   }
   else if (navigator.userAgent != null && navigator.userAgent != '') {
      var ua = navigator.userAgent.toLowerCase();
      if (ua.indexOf("msie") != -1 || ua.indexOf("trident") != -1) {
         zoomFactor = screen.deviceXDPI/screen.logicalXDPI;
         SVG_IDX2_attrScale = tipScale/zoomFactor;
         SVG_IDX2_rightEdge /= zoomFactor;
      }
      else if (ua.indexOf("ipad") != -1) {
         zoomFactor = SVG_IDX2_SVGRoot.clientWidth / window.innerWidth;
         SVG_IDX2_attrScale = 1.5 / zoomFactor;
         SVG_IDX2_rightEdge /= zoomFactor;
      }
      else if (ua.indexOf("opera") != -1)
         SVG_IDX2_attrScale = tipScale;
      else if (ua.indexOf("firefox") != -1)
         SVG_IDX2_attrScale = tipScale;
      else {
         if (SVG_IDX2_SVGWidth > 0 || SVG_IDX2_SVGHeight > 0)
            zoomFactor = 1;
         else
            zoomFactor = parseInt(document.defaultView.getComputedStyle(SVG_IDX2_SVGRoot, null).width,10)/
                                  SVG_IDX2_SVGRoot.clientWidth;
         SVG_IDX2_attrScale = tipScale/zoomFactor;
         SVG_IDX2_rightEdge *= zoomFactor;
      }
   }
}
function SVG_IDX2_GetTrueCoords(evt)
{
   var trans = SVG_IDX2_SVGRoot.currentTranslate;
   var scale = SVG_IDX2_SVGRoot.currentScale;
   SVG_IDX2_GetScaleFactors();
   var p1    = SVG_IDX2_SVGRoot.createSVGPoint();
   var p2;
      var m = SVG_IDX2_SVGRoot.getScreenCTM();
      if (navigator.userAgent.toLowerCase().indexOf("ipad") != -1) {
         p1.x = evt.clientX + window.pageXOffset;
         p1.y = evt.clientY + window.pageYOffset;
      }
      else {
      p1.x = evt.clientX;
      p1.y = evt.clientY;
      }
      p2 = p1.matrixTransform(m.inverse());
   SVG_IDX2_TrueCoords.x = Math.round(p2.x*100) / 100;
   SVG_IDX2_TrueCoords.y = Math.round(p2.y*100) / 100;
}
function SVG_IDX2_HideTooltip( evt )
{
   SVG_IDX2_tiptspan.firstChild.nodeValue = null;
   SVG_IDX2_singleTip.setAttributeNS(null, 'visibility', 'hidden');
}
function SVG_IDX2_ShowTooltip( evt )
{
   SVG_IDX2_GetTrueCoords( evt );
   var targetElement = evt.target;
   var tspanCount = targetElement.getElementsByTagName('desc').length;
   if (tspanCount == 1) {
      var targetTspan = targetElement.getElementsByTagName('desc').item(0);
      if ( targetTspan) {
         if (targetTspan.firstChild != null)
            SVG_IDX2_tiptspan.firstChild.nodeValue = targetTspan.firstChild.nodeValue; }
   }
   if ( '' != SVG_IDX2_tiptspan.firstChild.nodeValue )
   {
      var outline = SVG_IDX2_singleText.getBBox();
      SVG_IDX2_singleBox.setAttributeNS(null, 'transform', 'scale(' + SVG_IDX2_attrScale + ',' + SVG_IDX2_attrScale + ')' );
      SVG_IDX2_singleText.setAttributeNS(null, 'transform', 'scale(' + SVG_IDX2_attrScale + ',' + SVG_IDX2_attrScale + ')' );
      SVG_IDX2_singleTip.setAttributeNS(null, 'visibility', 'visible');
      if (evt.clientX + ((outline.width + 4)/0.47999) * SVG_IDX2_attrScale > SVG_IDX2_rightEdge) {
         var xPos = SVG_IDX2_TrueCoords.x - parseInt((outline.width + 4)*SVG_IDX2_attrScale);
         if (xPos < 0)
            xPos = 0;
      }
      else
         var xPos = SVG_IDX2_TrueCoords.x;
      if (SVG_IDX2_TrueCoords.y < 9) {
         var yPos = SVG_IDX2_TrueCoords.y + ((outline.height + 9)/0.47999)*SVG_IDX2_attrScale;
         if (yPos > windowHeight)
            yPos = SVG_IDX2_TrueCoords.y - parseInt((outline.height + 4)*SVG_IDX2_attrScale);
      }
      else
         var yPos = SVG_IDX2_TrueCoords.y - parseInt((outline.height + 4)*SVG_IDX2_attrScale);
      if (Number(outline.width == 0))
         SVG_IDX2_singleBox.setAttributeNS(null, 'width', outline.width);
      else
         SVG_IDX2_singleBox.setAttributeNS(null, 'width', outline.width + 4);
      SVG_IDX2_singleBox.setAttributeNS(null, 'height', outline.height + 4);
      SVG_IDX2_singleTip.setAttributeNS(null, 'transform', 'translate(' + xPos + ',' + yPos + ')');
   }
}

<script type="text/ecmascript">
var SVG_IDX3_SVGRoot = null;
var SVG_IDX3_TrueCoords = null;
var SVG_IDX3_singleTip = null;
var SVG_IDX3_singleBox = null;
var SVG_IDX3_singleText = null;
var SVG_IDX3_tiptspan = null;
var SVG_IDX3_attrScale = 1;
var SVG_IDX3_rightEdge = null;
var SVG_IDX3_SVGHeight = null;
var SVG_IDX3_SVGWidth = null;
function SVG_IDX3_Init(anchor) {
   SVG_IDX3_SVGRoot = document.getElementById(anchor);
   SVG_IDX3_TrueCoords = SVG_IDX3_SVGRoot.createSVGPoint();
   SVG_IDX3_singleTip = document.getElementById(anchor + '_singleTip1');
   SVG_IDX3_singleBox = document.getElementById(anchor + '_singleBox1');
   SVG_IDX3_singleText = document.getElementById(anchor + '_singleText1');
   SVG_IDX3_tiptspan = document.getElementById(anchor + '_tiptspan1');
   SVG_IDX3_tiptspan.firstChild.nodeValue = null;
   SVG_IDX3_SVGRoot.addEventListener('mousemove', SVG_IDX3_ShowTooltip, false);
   SVG_IDX3_SVGRoot.addEventListener('mouseout', SVG_IDX3_HideTooltip, false);
   SVG_IDX3_SVGHeight = SVG_IDX3_SVGRoot.getAttributeNS(null, "height");
   SVG_IDX3_SVGWidth = SVG_IDX3_SVGRoot.getAttributeNS(null, "width");
   if (!isNaN(parseFloat(SVG_IDX3_SVGHeight)) && !isNaN(parseFloat(SVG_IDX3_SVGWidth)))
      SVG_IDX3_GetHW();
}
function SVG_IDX3_GetHW()
{
    if (SVG_IDX3_SVGWidth != null && SVG_IDX3_SVGWidth != "") {
       if (SVG_IDX3_SVGWidth.match(/%/)) {
          var factor = parseFloat(SVG_IDX3_SVGWidth.replace(/%/,""))/100;
          SVG_IDX3_SVGWidth = window.innerWidth * factor;
       }
       else if (SVG_IDX3_SVGWidth.match(/in/))
          SVG_IDX3_SVGWidth = parseFloat(SVG_IDX3_SVGWidth.replace(/in/,""))*96;
       else if (SVG_IDX3_SVGWidth.match(/cm/))
          SVG_IDX3_SVGWidth = parseFloat(SVG_IDX3_SVGWidth.replace(/in/,""))*96/2.54;
       else
           SVG_IDX3_SVGWidth = parseFloat(SVG_IDX3_SVGWidth);
    }
    if (SVG_IDX3_SVGHeight != null && SVG_IDX3_SVGHeight != "") {
       if (SVG_IDX3_SVGHeight.match(/%/)) {
          var factor = parseFloat(SVG_IDX3_SVGHeight.replace(/%/,""))/100;
          SVG_IDX3_SVGHeight = window.innerHeight * factor;
       }
       else if (SVG_IDX3_SVGHeight.match(/in/))
          SVG_IDX3_SVGHeight = parseFloat(SVG_IDX3_SVGHeight.replace(/in/,""))*96;
       else if (SVG_IDX3_SVGHeight.match(/cm/))
          SVG_IDX3_SVGHeight = parseFloat(SVG_IDX3_SVGHeight.replace(/in/,""))*96/2.54;
       else
           SVG_IDX3_SVGHeight = parseFloat(SVG_IDX3_SVGHeight);
    }
}
function SVG_IDX3_GetScaleFactors(evt)
{
   var zoomFactor = 1;
   windowWidth  = (top.innerWidth==undefined)  ? window.innerWidth  : top.innerWidth;
   windowHeight = (top.innerHeight==undefined) ? window.innerHeight : top.innerHeight;
   SVG_IDX3_rightEdge = (SVG_IDX3_SVGWidth) ? SVG_IDX3_SVGWidth - window.pageXOffset : windowWidth;
   if (parseFloat(SVG_IDX3_SVGWidth) > 0 || parseFloat(SVG_IDX3_SVGHeight) > 0)
      var tipScale = 3.125;
   else {
      var tipXScale  = (screen.width/windowWidth) / SVG_IDX3_SVGRoot.currentScale;
      var tipYScale  = (screen.height/windowHeight) / SVG_IDX3_SVGRoot.currentScale;
      var tipScale   = (tipXScale + tipYScale)/2.0;
   }
   SVG_IDX3_attrScale = tipScale;
   if (navigator.appName == 'Adobe SVG Viewer') {
      if (screen.deviceXDPI != null && screen.logicalXDPI != null)
         zoomFactor = screen.deviceXDPI/screen.logicalXDPI;
      SVG_IDX3_attrScale = zoomFactor*tipScale;
   }
   else if (navigator.userAgent != null && navigator.userAgent != '') {
      var ua = navigator.userAgent.toLowerCase();
      if (ua.indexOf("msie") != -1 || ua.indexOf("trident") != -1) {
         zoomFactor = screen.deviceXDPI/screen.logicalXDPI;
         SVG_IDX3_attrScale = tipScale/zoomFactor;
         SVG_IDX3_rightEdge /= zoomFactor;
      }
      else if (ua.indexOf("ipad") != -1) {
         zoomFactor = SVG_IDX3_SVGRoot.clientWidth / window.innerWidth;
         SVG_IDX3_attrScale = 1.5 / zoomFactor;
         SVG_IDX3_rightEdge /= zoomFactor;
      }
      else if (ua.indexOf("opera") != -1)
         SVG_IDX3_attrScale = tipScale;
      else if (ua.indexOf("firefox") != -1)
         SVG_IDX3_attrScale = tipScale;
      else {
         if (SVG_IDX3_SVGWidth > 0 || SVG_IDX3_SVGHeight > 0)
            zoomFactor = 1;
         else
            zoomFactor = parseInt(document.defaultView.getComputedStyle(SVG_IDX3_SVGRoot, null).width,10)/
                                  SVG_IDX3_SVGRoot.clientWidth;
         SVG_IDX3_attrScale = tipScale/zoomFactor;
         SVG_IDX3_rightEdge *= zoomFactor;
      }
   }
}
function SVG_IDX3_GetTrueCoords(evt)
{
   var trans = SVG_IDX3_SVGRoot.currentTranslate;
   var scale = SVG_IDX3_SVGRoot.currentScale;
   SVG_IDX3_GetScaleFactors();
   var p1    = SVG_IDX3_SVGRoot.createSVGPoint();
   var p2;
      var m = SVG_IDX3_SVGRoot.getScreenCTM();
      if (navigator.userAgent.toLowerCase().indexOf("ipad") != -1) {
         p1.x = evt.clientX + window.pageXOffset;
         p1.y = evt.clientY + window.pageYOffset;
      }
      else {
      p1.x = evt.clientX;
      p1.y = evt.clientY;
      }
      p2 = p1.matrixTransform(m.inverse());
   SVG_IDX3_TrueCoords.x = Math.round(p2.x*100) / 100;
   SVG_IDX3_TrueCoords.y = Math.round(p2.y*100) / 100;
}
function SVG_IDX3_HideTooltip( evt )
{
   SVG_IDX3_tiptspan.firstChild.nodeValue = null;
   SVG_IDX3_singleTip.setAttributeNS(null, 'visibility', 'hidden');
}
function SVG_IDX3_ShowTooltip( evt )
{
   SVG_IDX3_GetTrueCoords( evt );
   var targetElement = evt.target;
   var tspanCount = targetElement.getElementsByTagName('desc').length;
   if (tspanCount == 1) {
      var targetTspan = targetElement.getElementsByTagName('desc').item(0);
      if ( targetTspan) {
         if (targetTspan.firstChild != null)
            SVG_IDX3_tiptspan.firstChild.nodeValue = targetTspan.firstChild.nodeValue; }
   }
   if ( '' != SVG_IDX3_tiptspan.firstChild.nodeValue )
   {
      var outline = SVG_IDX3_singleText.getBBox();
      SVG_IDX3_singleBox.setAttributeNS(null, 'transform', 'scale(' + SVG_IDX3_attrScale + ',' + SVG_IDX3_attrScale + ')' );
      SVG_IDX3_singleText.setAttributeNS(null, 'transform', 'scale(' + SVG_IDX3_attrScale + ',' + SVG_IDX3_attrScale + ')' );
      SVG_IDX3_singleTip.setAttributeNS(null, 'visibility', 'visible');
      if (evt.clientX + ((outline.width + 4)/0.47999) * SVG_IDX3_attrScale > SVG_IDX3_rightEdge) {
         var xPos = SVG_IDX3_TrueCoords.x - parseInt((outline.width + 4)*SVG_IDX3_attrScale);
         if (xPos < 0)
            xPos = 0;
      }
      else
         var xPos = SVG_IDX3_TrueCoords.x;
      if (SVG_IDX3_TrueCoords.y < 9) {
         var yPos = SVG_IDX3_TrueCoords.y + ((outline.height + 9)/0.47999)*SVG_IDX3_attrScale;
         if (yPos > windowHeight)
            yPos = SVG_IDX3_TrueCoords.y - parseInt((outline.height + 4)*SVG_IDX3_attrScale);
      }
      else
         var yPos = SVG_IDX3_TrueCoords.y - parseInt((outline.height + 4)*SVG_IDX3_attrScale);
      if (Number(outline.width == 0))
         SVG_IDX3_singleBox.setAttributeNS(null, 'width', outline.width);
      else
         SVG_IDX3_singleBox.setAttributeNS(null, 'width', outline.width + 4);
      SVG_IDX3_singleBox.setAttributeNS(null, 'height', outline.height + 4);
      SVG_IDX3_singleTip.setAttributeNS(null, 'transform', 'translate(' + xPos + ',' + yPos + ')');
   }
}
</script>

<div class="c">
<script type="text/ecmascript">
var SVG_IDX4_SVGRoot = null;
var SVG_IDX4_TrueCoords = null;
var SVG_IDX4_singleTip = null;
var SVG_IDX4_singleBox = null;
var SVG_IDX4_singleText = null;
var SVG_IDX4_tiptspan = null;
var SVG_IDX4_attrScale = 1;
var SVG_IDX4_rightEdge = null;
var SVG_IDX4_SVGHeight = null;
var SVG_IDX4_SVGWidth = null;
function SVG_IDX4_Init(anchor) {
   SVG_IDX4_SVGRoot = document.getElementById(anchor);
   SVG_IDX4_TrueCoords = SVG_IDX4_SVGRoot.createSVGPoint();
   SVG_IDX4_singleTip = document.getElementById(anchor + '_singleTip1');
   SVG_IDX4_singleBox = document.getElementById(anchor + '_singleBox1');
   SVG_IDX4_singleText = document.getElementById(anchor + '_singleText1');
   SVG_IDX4_tiptspan = document.getElementById(anchor + '_tiptspan1');
   SVG_IDX4_tiptspan.firstChild.nodeValue = null;
   SVG_IDX4_SVGRoot.addEventListener('mousemove', SVG_IDX4_ShowTooltip, false);
   SVG_IDX4_SVGRoot.addEventListener('mouseout', SVG_IDX4_HideTooltip, false);
   SVG_IDX4_SVGHeight = SVG_IDX4_SVGRoot.getAttributeNS(null, "height");
   SVG_IDX4_SVGWidth = SVG_IDX4_SVGRoot.getAttributeNS(null, "width");
   if (!isNaN(parseFloat(SVG_IDX4_SVGHeight)) && !isNaN(parseFloat(SVG_IDX4_SVGWidth)))
      SVG_IDX4_GetHW();
}
function SVG_IDX4_GetHW()
{
    if (SVG_IDX4_SVGWidth != null && SVG_IDX4_SVGWidth != "") {
       if (SVG_IDX4_SVGWidth.match(/%/)) {
          var factor = parseFloat(SVG_IDX4_SVGWidth.replace(/%/,""))/100;
          SVG_IDX4_SVGWidth = window.innerWidth * factor;
       }
       else if (SVG_IDX4_SVGWidth.match(/in/))
          SVG_IDX4_SVGWidth = parseFloat(SVG_IDX4_SVGWidth.replace(/in/,""))*96;
       else if (SVG_IDX4_SVGWidth.match(/cm/))
          SVG_IDX4_SVGWidth = parseFloat(SVG_IDX4_SVGWidth.replace(/in/,""))*96/2.54;
       else
           SVG_IDX4_SVGWidth = parseFloat(SVG_IDX4_SVGWidth);
    }
    if (SVG_IDX4_SVGHeight != null && SVG_IDX4_SVGHeight != "") {
       if (SVG_IDX4_SVGHeight.match(/%/)) {
          var factor = parseFloat(SVG_IDX4_SVGHeight.replace(/%/,""))/100;
          SVG_IDX4_SVGHeight = window.innerHeight * factor;
       }
       else if (SVG_IDX4_SVGHeight.match(/in/))
          SVG_IDX4_SVGHeight = parseFloat(SVG_IDX4_SVGHeight.replace(/in/,""))*96;
       else if (SVG_IDX4_SVGHeight.match(/cm/))
          SVG_IDX4_SVGHeight = parseFloat(SVG_IDX4_SVGHeight.replace(/in/,""))*96/2.54;
       else
           SVG_IDX4_SVGHeight = parseFloat(SVG_IDX4_SVGHeight);
    }
}
function SVG_IDX4_GetScaleFactors(evt)
{
   var zoomFactor = 1;
   windowWidth  = (top.innerWidth==undefined)  ? window.innerWidth  : top.innerWidth;
   windowHeight = (top.innerHeight==undefined) ? window.innerHeight : top.innerHeight;
   SVG_IDX4_rightEdge = (SVG_IDX4_SVGWidth) ? SVG_IDX4_SVGWidth - window.pageXOffset : windowWidth;
   if (parseFloat(SVG_IDX4_SVGWidth) > 0 || parseFloat(SVG_IDX4_SVGHeight) > 0)
      var tipScale = 3.125;
   else {
      var tipXScale  = (screen.width/windowWidth) / SVG_IDX4_SVGRoot.currentScale;
      var tipYScale  = (screen.height/windowHeight) / SVG_IDX4_SVGRoot.currentScale;
      var tipScale   = (tipXScale + tipYScale)/2.0;
   }
   SVG_IDX4_attrScale = tipScale;
   if (navigator.appName == 'Adobe SVG Viewer') {
      if (screen.deviceXDPI != null && screen.logicalXDPI != null)
         zoomFactor = screen.deviceXDPI/screen.logicalXDPI;
      SVG_IDX4_attrScale = zoomFactor*tipScale;
   }
   else if (navigator.userAgent != null && navigator.userAgent != '') {
      var ua = navigator.userAgent.toLowerCase();
      if (ua.indexOf("msie") != -1 || ua.indexOf("trident") != -1) {
         zoomFactor = screen.deviceXDPI/screen.logicalXDPI;
         SVG_IDX4_attrScale = tipScale/zoomFactor;
         SVG_IDX4_rightEdge /= zoomFactor;
      }
      else if (ua.indexOf("ipad") != -1) {
         zoomFactor = SVG_IDX4_SVGRoot.clientWidth / window.innerWidth;
         SVG_IDX4_attrScale = 1.5 / zoomFactor;
         SVG_IDX4_rightEdge /= zoomFactor;
      }
      else if (ua.indexOf("opera") != -1)
         SVG_IDX4_attrScale = tipScale;
      else if (ua.indexOf("firefox") != -1)
         SVG_IDX4_attrScale = tipScale;
      else {
         if (SVG_IDX4_SVGWidth > 0 || SVG_IDX4_SVGHeight > 0)
            zoomFactor = 1;
         else
            zoomFactor = parseInt(document.defaultView.getComputedStyle(SVG_IDX4_SVGRoot, null).width,10)/
                                  SVG_IDX4_SVGRoot.clientWidth;
         SVG_IDX4_attrScale = tipScale/zoomFactor;
         SVG_IDX4_rightEdge *= zoomFactor;
      }
   }
}
function SVG_IDX4_GetTrueCoords(evt)
{
   var trans = SVG_IDX4_SVGRoot.currentTranslate;
   var scale = SVG_IDX4_SVGRoot.currentScale;
   SVG_IDX4_GetScaleFactors();
   var p1    = SVG_IDX4_SVGRoot.createSVGPoint();
   var p2;
      var m = SVG_IDX4_SVGRoot.getScreenCTM();
      if (navigator.userAgent.toLowerCase().indexOf("ipad") != -1) {
         p1.x = evt.clientX + window.pageXOffset;
         p1.y = evt.clientY + window.pageYOffset;
      }
      else {
      p1.x = evt.clientX;
      p1.y = evt.clientY;
      }
      p2 = p1.matrixTransform(m.inverse());
   SVG_IDX4_TrueCoords.x = Math.round(p2.x*100) / 100;
   SVG_IDX4_TrueCoords.y = Math.round(p2.y*100) / 100;
}
function SVG_IDX4_HideTooltip( evt )
{
   SVG_IDX4_tiptspan.firstChild.nodeValue = null;
   SVG_IDX4_singleTip.setAttributeNS(null, 'visibility', 'hidden');
}
function SVG_IDX4_ShowTooltip( evt )
{
   SVG_IDX4_GetTrueCoords( evt );
   var targetElement = evt.target;
   var tspanCount = targetElement.getElementsByTagName('desc').length;
   if (tspanCount == 1) {
      var targetTspan = targetElement.getElementsByTagName('desc').item(0);
      if ( targetTspan) {
         if (targetTspan.firstChild != null)
            SVG_IDX4_tiptspan.firstChild.nodeValue = targetTspan.firstChild.nodeValue; }
   }
   if ( '' != SVG_IDX4_tiptspan.firstChild.nodeValue )
   {
      var outline = SVG_IDX4_singleText.getBBox();
      SVG_IDX4_singleBox.setAttributeNS(null, 'transform', 'scale(' + SVG_IDX4_attrScale + ',' + SVG_IDX4_attrScale + ')' );
      SVG_IDX4_singleText.setAttributeNS(null, 'transform', 'scale(' + SVG_IDX4_attrScale + ',' + SVG_IDX4_attrScale + ')' );
      SVG_IDX4_singleTip.setAttributeNS(null, 'visibility', 'visible');
      if (evt.clientX + ((outline.width + 4)/0.47999) * SVG_IDX4_attrScale > SVG_IDX4_rightEdge) {
         var xPos = SVG_IDX4_TrueCoords.x - parseInt((outline.width + 4)*SVG_IDX4_attrScale);
         if (xPos < 0)
            xPos = 0;
      }
      else
         var xPos = SVG_IDX4_TrueCoords.x;
      if (SVG_IDX4_TrueCoords.y < 9) {
         var yPos = SVG_IDX4_TrueCoords.y + ((outline.height + 9)/0.47999)*SVG_IDX4_attrScale;
         if (yPos > windowHeight)
            yPos = SVG_IDX4_TrueCoords.y - parseInt((outline.height + 4)*SVG_IDX4_attrScale);
      }
      else
         var yPos = SVG_IDX4_TrueCoords.y - parseInt((outline.height + 4)*SVG_IDX4_attrScale);
      if (Number(outline.width == 0))
         SVG_IDX4_singleBox.setAttributeNS(null, 'width', outline.width);
      else
         SVG_IDX4_singleBox.setAttributeNS(null, 'width', outline.width + 4);
      SVG_IDX4_singleBox.setAttributeNS(null, 'height', outline.height + 4);
      SVG_IDX4_singleTip.setAttributeNS(null, 'transform', 'translate(' + xPos + ',' + yPos + ')');
   }
}
</script>

<script type="text/ecmascript">
var SVG_IDX7_SVGRoot = null;
var SVG_IDX7_TrueCoords = null;
var SVG_IDX7_singleTip = null;
var SVG_IDX7_singleBox = null;
var SVG_IDX7_singleText = null;
var SVG_IDX7_tiptspan = null;
var SVG_IDX7_attrScale = 1;
var SVG_IDX7_rightEdge = null;
var SVG_IDX7_SVGHeight = null;
var SVG_IDX7_SVGWidth = null;
function SVG_IDX7_Init(anchor) {
   SVG_IDX7_SVGRoot = document.getElementById(anchor);
   SVG_IDX7_TrueCoords = SVG_IDX7_SVGRoot.createSVGPoint();
   SVG_IDX7_singleTip = document.getElementById(anchor + '_singleTip1');
   SVG_IDX7_singleBox = document.getElementById(anchor + '_singleBox1');
   SVG_IDX7_singleText = document.getElementById(anchor + '_singleText1');
   SVG_IDX7_tiptspan = document.getElementById(anchor + '_tiptspan1');
   SVG_IDX7_tiptspan.firstChild.nodeValue = null;
   SVG_IDX7_SVGRoot.addEventListener('mousemove', SVG_IDX7_ShowTooltip, false);
   SVG_IDX7_SVGRoot.addEventListener('mouseout', SVG_IDX7_HideTooltip, false);
   SVG_IDX7_SVGHeight = SVG_IDX7_SVGRoot.getAttributeNS(null, "height");
   SVG_IDX7_SVGWidth = SVG_IDX7_SVGRoot.getAttributeNS(null, "width");
   if (!isNaN(parseFloat(SVG_IDX7_SVGHeight)) && !isNaN(parseFloat(SVG_IDX7_SVGWidth)))
      SVG_IDX7_GetHW();
}
function SVG_IDX7_GetHW()
{
    if (SVG_IDX7_SVGWidth != null && SVG_IDX7_SVGWidth != "") {
       if (SVG_IDX7_SVGWidth.match(/%/)) {
          var factor = parseFloat(SVG_IDX7_SVGWidth.replace(/%/,""))/100;
          SVG_IDX7_SVGWidth = window.innerWidth * factor;
       }
       else if (SVG_IDX7_SVGWidth.match(/in/))
          SVG_IDX7_SVGWidth = parseFloat(SVG_IDX7_SVGWidth.replace(/in/,""))*96;
       else if (SVG_IDX7_SVGWidth.match(/cm/))
          SVG_IDX7_SVGWidth = parseFloat(SVG_IDX7_SVGWidth.replace(/in/,""))*96/2.54;
       else
           SVG_IDX7_SVGWidth = parseFloat(SVG_IDX7_SVGWidth);
    }
    if (SVG_IDX7_SVGHeight != null && SVG_IDX7_SVGHeight != "") {
       if (SVG_IDX7_SVGHeight.match(/%/)) {
          var factor = parseFloat(SVG_IDX7_SVGHeight.replace(/%/,""))/100;
          SVG_IDX7_SVGHeight = window.innerHeight * factor;
       }
       else if (SVG_IDX7_SVGHeight.match(/in/))
          SVG_IDX7_SVGHeight = parseFloat(SVG_IDX7_SVGHeight.replace(/in/,""))*96;
       else if (SVG_IDX7_SVGHeight.match(/cm/))
          SVG_IDX7_SVGHeight = parseFloat(SVG_IDX7_SVGHeight.replace(/in/,""))*96/2.54;
       else
           SVG_IDX7_SVGHeight = parseFloat(SVG_IDX7_SVGHeight);
    }
}
function SVG_IDX7_GetScaleFactors(evt)

function SVG_IDX9_GetHW()
{
    if (SVG_IDX9_SVGWidth != null && SVG_IDX9_SVGWidth != "") {

          SVG_IDX9_SVGWidth = window.innerWidth * factor;
       }
       else if (SVG_IDX9_SVGWidth.match(/in/))
          SVG_IDX9_SVGWidth = parseFloat(SVG_IDX9_SVGWidth.replace(/in/,""))*96;
       else if (SVG_IDX9_SVGWidth.match(/cm/))
          SVG_IDX9_SVGWidth = parseFloat(SVG_IDX9_SVGWidth.replace(/in/,""))*96/2.54;
       else
           SVG_IDX9_SVGWidth = parseFloat(SVG_IDX9_SVGWidth);
    }
    if (SVG_IDX9_SVGHeight != null && SVG_IDX9_SVGHeight != "") {
       if (SVG_IDX9_SVGHeight.match(/%/)) {
          var factor = parseFloat(SVG_IDX9_SVGHeight.replace(/%/,""))/100;
          SVG_IDX9_SVGHeight = window.innerHeight * factor;
       }
       else if (SVG_IDX9_SVGHeight.match(/in/))
          SVG_IDX9_SVGHeight = parseFloat(SVG_IDX9_SVGHeight.replace(/in/,""))*96;
       else if (SVG_IDX9_SVGHeight.match(/cm/))
          SVG_IDX9_SVGHeight = parseFloat(SVG_IDX9_SVGHeight.replace(/in/,""))*96/2.54;

           SVG_IDX9_SVGHeight = parseFloat(SVG_IDX9_SVGHeight);

function SVG_IDX9_GetScaleFactors(evt)

      var tipYScale  = (screen.height/windowHeight) / SVG_IDX9_SVGRoot.currentScale;
      var tipScale   = (tipXScale + tipYScale)/2.0;

   SVG_IDX9_attrScale = tipScale;

      SVG_IDX9_attrScale = zoomFactor*tipScale;
   }
   else if (navigator.userAgent != null && navigator.userAgent != '') {
      var ua = navigator.userAgent.toLowerCase();

         SVG_IDX9_attrScale = tipScale/zoomFactor;
         SVG_IDX9_rightEdge /= zoomFactor;
      }
      else if (ua.indexOf("ipad") != -1) {

         SVG_IDX9_attrScale = 1.5 / zoomFactor;
         SVG_IDX9_rightEdge /= zoomFactor;
      }
      else if (ua.indexOf("opera") != -1)
         SVG_IDX9_attrScale = tipScale;
      else if (ua.indexOf("firefox") != -1)
         SVG_IDX9_attrScale = tipScale;
      else {
         if (SVG_IDX9_SVGWidth > 0 || SVG_IDX9_SVGHeight > 0)

function SVG_IDX9_GetTrueCoords(evt)
{
   var trans = SVG_IDX9_SVGRoot.currentTranslate;
   var scale = SVG_IDX9_SVGRoot.currentScale;
   SVG_IDX9_GetScaleFactors();
   var p1    = SVG_IDX9_SVGRoot.createSVGPoint();
   var p2;
      var m = SVG_IDX9_SVGRoot.getScreenCTM();
      if (navigator.userAgent.toLowerCase().indexOf("ipad") != -1) {

function SVG_IDX10_Init(anchor) {
   SVG_IDX10_SVGRoot = document.getElementById(anchor);
   SVG_IDX10_TrueCoords = SVG_IDX10_SVGRoot.createSVGPoint();
   SVG_IDX10_singleTip = document.getElementById(anchor + '_singleTip1');
   SVG_IDX10_singleBox = document.getElementById(anchor + '_singleBox1');
   SVG_IDX10_singleText = document.getElementById(anchor + '_singleText1');
   SVG_IDX10_tiptspan = document.getElementById(anchor + '_tiptspan1');
   SVG_IDX10_tiptspan.firstChild.nodeValue = null;
   SVG_IDX10_SVGRoot.addEventListener('mousemove', SVG_IDX10_ShowTooltip, false);
   SVG_IDX10_SVGRoot.addEventListener('mouseout', SVG_IDX10_HideTooltip, false);
   SVG_IDX10_SVGHeight = SVG_IDX10_SVGRoot.getAttributeNS(null, "height");
   SVG_IDX10_SVGWidth = SVG_IDX10_SVGRoot.getAttributeNS(null, "width");
   if (!isNaN(parseFloat(SVG_IDX10_SVGHeight)) && !isNaN(parseFloat(SVG_IDX10_SVGWidth)))
      SVG_IDX10_GetHW();
}
function SVG_IDX10_GetHW()
{
    if (SVG_IDX10_SVGWidth != null && SVG_IDX10_SVGWidth != "") {
       if (SVG_IDX10_SVGWidth.match(/%/)) {
          var factor = parseFloat(SVG_IDX10_SVGWidth.replace(/%/,""))/100;
          SVG_IDX10_SVGWidth = window.innerWidth * factor;
       }
       else if (SVG_IDX10_SVGWidth.match(/in/))
          SVG_IDX10_SVGWidth = parseFloat(SVG_IDX10_SVGWidth.replace(/in/,""))*96;
       else if (SVG_IDX10_SVGWidth.match(/cm/))
          SVG_IDX10_SVGWidth = parseFloat(SVG_IDX10_SVGWidth.replace(/in/,""))*96/2.54;
       else
           SVG_IDX10_SVGWidth = parseFloat(SVG_IDX10_SVGWidth);
    }
    if (SVG_IDX10_SVGHeight != null && SVG_IDX10_SVGHeight != "") {
       if (SVG_IDX10_SVGHeight.match(/%/)) {
          var factor = parseFloat(SVG_IDX10_SVGHeight.replace(/%/,""))/100;
          SVG_IDX10_SVGHeight = window.innerHeight * factor;
       }
       else if (SVG_IDX10_SVGHeight.match(/in/))
          SVG_IDX10_SVGHeight = parseFloat(SVG_IDX10_SVGHeight.replace(/in/,""))*96;
       else if (SVG_IDX10_SVGHeight.match(/cm/))
          SVG_IDX10_SVGHeight = parseFloat(SVG_IDX10_SVGHeight.replace(/in/,""))*96/2.54;
       else
           SVG_IDX10_SVGHeight = parseFloat(SVG_IDX10_SVGHeight);
    }
}
function SVG_IDX10_GetScaleFactors(evt)
{
   var zoomFactor = 1;
   windowWidth  = (top.innerWidth==undefined)  ? window.innerWidth  : top.innerWidth;
   windowHeight = (top.innerHeight==undefined) ? window.innerHeight : top.innerHeight;
   SVG_IDX10_rightEdge = (SVG_IDX10_SVGWidth) ? SVG_IDX10_SVGWidth - window.pageXOffset : windowWidth;
   if (parseFloat(SVG_IDX10_SVGWidth) > 0 || parseFloat(SVG_IDX10_SVGHeight) > 0)
      var tipScale = 3.125;
   else {
      var tipXScale  = (screen.width/windowWidth) / SVG_IDX10_SVGRoot.currentScale;
      var tipYScale  = (screen.height/windowHeight) / SVG_IDX10_SVGRoot.currentScale;
      var tipScale   = (tipXScale + tipYScale)/2.0;
   }
   SVG_IDX10_attrScale = tipScale;
   if (navigator.appName == 'Adobe SVG Viewer') {
      if (screen.deviceXDPI != null && screen.logicalXDPI != null)
         zoomFactor = screen.deviceXDPI/screen.logicalXDPI;
      SVG_IDX10_attrScale = zoomFactor*tipScale;
   }
   else if (navigator.userAgent != null && navigator.userAgent != '') {
      var ua = navigator.userAgent.toLowerCase();
      if (ua.indexOf("msie") != -1 || ua.indexOf("trident") != -1) {
         zoomFactor = screen.deviceXDPI/screen.logicalXDPI;
         SVG_IDX10_attrScale = tipScale/zoomFactor;
         SVG_IDX10_rightEdge /= zoomFactor;
      }
      else if (ua.indexOf("ipad") != -1) {
         zoomFactor = SVG_IDX10_SVGRoot.clientWidth / window.innerWidth;
         SVG_IDX10_attrScale = 1.5 / zoomFactor;
         SVG_IDX10_rightEdge /= zoomFactor;
      }
      else if (ua.indexOf("opera") != -1)
         SVG_IDX10_attrScale = tipScale;
      else if (ua.indexOf("firefox") != -1)
         SVG_IDX10_attrScale = tipScale;
      else {
         if (SVG_IDX10_SVGWidth > 0 || SVG_IDX10_SVGHeight > 0)
            zoomFactor = 1;
         else

function SVG_IDX10_GetTrueCoords(evt)
{

   SVG_IDX10_GetScaleFactors();
   var p1    = SVG_IDX10_SVGRoot.createSVGPoint();
   var p2;
      var m = SVG_IDX10_SVGRoot.getScreenCTM();
      if (navigator.userAgent.toLowerCase().indexOf("ipad") != -1) {
         p1.x = evt.clientX + window.pageXOffset;

<script type="text/ecmascript">
var SVG_IDX11_SVGRoot = null;

var SVG_IDX11_rightEdge = null;
var SVG_IDX11_SVGHeight = null;

function SVG_IDX11_Init(anchor) {
   SVG_IDX11_SVGRoot = document.getElementById(anchor);
   SVG_IDX11_TrueCoords = SVG_IDX11_SVGRoot.createSVGPoint();
   SVG_IDX11_singleTip = document.getElementById(anchor + '_singleTip1');
   SVG_IDX11_singleBox = document.getElementById(anchor + '_singleBox1');
   SVG_IDX11_singleText = document.getElementById(anchor + '_singleText1');
   SVG_IDX11_tiptspan = document.getElementById(anchor + '_tiptspan1');
   SVG_IDX11_tiptspan.firstChild.nodeValue = null;
   SVG_IDX11_SVGRoot.addEventListener('mousemove', SVG_IDX11_ShowTooltip, false);
   SVG_IDX11_SVGRoot.addEventListener('mouseout', SVG_IDX11_HideTooltip, false);
   SVG_IDX11_SVGHeight = SVG_IDX11_SVGRoot.getAttributeNS(null, "height");
   SVG_IDX11_SVGWidth = SVG_IDX11_SVGRoot.getAttributeNS(null, "width");
   if (!isNaN(parseFloat(SVG_IDX11_SVGHeight)) && !isNaN(parseFloat(SVG_IDX11_SVGWidth)))
      SVG_IDX11_GetHW();
}
function SVG_IDX11_GetHW()
{
    if (SVG_IDX11_SVGWidth != null && SVG_IDX11_SVGWidth != "") {
       if (SVG_IDX11_SVGWidth.match(/%/)) {
          var factor = parseFloat(SVG_IDX11_SVGWidth.replace(/%/,""))/100;
          SVG_IDX11_SVGWidth = window.innerWidth * factor;
       }
       else if (SVG_IDX11_SVGWidth.match(/in/))
          SVG_IDX11_SVGWidth = parseFloat(SVG_IDX11_SVGWidth.replace(/in/,""))*96;
       else if (SVG_IDX11_SVGWidth.match(/cm/))
          SVG_IDX11_SVGWidth = parseFloat(SVG_IDX11_SVGWidth.replace(/in/,""))*96/2.54;
       else
           SVG_IDX11_SVGWidth = parseFloat(SVG_IDX11_SVGWidth);
    }
    if (SVG_IDX11_SVGHeight != null && SVG_IDX11_SVGHeight != "") {
       if (SVG_IDX11_SVGHeight.match(/%/)) {
          var factor = parseFloat(SVG_IDX11_SVGHeight.replace(/%/,""))/100;
          SVG_IDX11_SVGHeight = window.innerHeight * factor;
       }
       else if (SVG_IDX11_SVGHeight.match(/in/))
          SVG_IDX11_SVGHeight = parseFloat(SVG_IDX11_SVGHeight.replace(/in/,""))*96;
       else if (SVG_IDX11_SVGHeight.match(/cm/))
          SVG_IDX11_SVGHeight = parseFloat(SVG_IDX11_SVGHeight.replace(/in/,""))*96/2.54;
       else
           SVG_IDX11_SVGHeight = parseFloat(SVG_IDX11_SVGHeight);
    }
}
function SVG_IDX11_GetScaleFactors(evt)
{
   var zoomFactor = 1;
   windowWidth  = (top.innerWidth==undefined)  ? window.innerWidth  : top.innerWidth;
   windowHeight = (top.innerHeight==undefined) ? window.innerHeight : top.innerHeight;
   SVG_IDX11_rightEdge = (SVG_IDX11_SVGWidth) ? SVG_IDX11_SVGWidth - window.pageXOffset : windowWidth;
   if (parseFloat(SVG_IDX11_SVGWidth) > 0 || parseFloat(SVG_IDX11_SVGHeight) > 0)
      var tipScale = 3.125;
   else {
      var tipXScale  = (screen.width/windowWidth) / SVG_IDX11_SVGRoot.currentScale;
      var tipYScale  = (screen.height/windowHeight) / SVG_IDX11_SVGRoot.currentScale;
      var tipScale   = (tipXScale + tipYScale)/2.0;
   }
   SVG_IDX11_attrScale = tipScale;
   if (navigator.appName == 'Adobe SVG Viewer') {
      if (screen.deviceXDPI != null && screen.logicalXDPI != null)
         zoomFactor = screen.deviceXDPI/screen.logicalXDPI;
      SVG_IDX11_attrScale = zoomFactor*tipScale;
   }
   else if (navigator.userAgent != null && navigator.userAgent != '') {
      var ua = navigator.userAgent.toLowerCase();
      if (ua.indexOf("msie") != -1 || ua.indexOf("trident") != -1) {
         zoomFactor = screen.deviceXDPI/screen.logicalXDPI;
         SVG_IDX11_attrScale = tipScale/zoomFactor;
         SVG_IDX11_rightEdge /= zoomFactor;
      }
      else if (ua.indexOf("ipad") != -1) {
         zoomFactor = SVG_IDX11_SVGRoot.clientWidth / window.innerWidth;
         SVG_IDX11_attrScale = 1.5 / zoomFactor;
         SVG_IDX11_rightEdge /= zoomFactor;
      }
      else if (ua.indexOf("opera") != -1)
         SVG_IDX11_attrScale = tipScale;
      else if (ua.indexOf("firefox") != -1)
         SVG_IDX11_attrScale = tipScale;
      else {
         if (SVG_IDX11_SVGWidth > 0 || SVG_IDX11_SVGHeight > 0)
            zoomFactor = 1;
         else
            zoomFactor = parseInt(document.defaultView.getComputedStyle(SVG_IDX11_SVGRoot, null).width,10)/
                                  SVG_IDX11_SVGRoot.clientWidth;
         SVG_IDX11_attrScale = tipScale/zoomFactor;
         SVG_IDX11_rightEdge *= zoomFactor;
      }
   }
}
function SVG_IDX11_GetTrueCoords(evt)
{
   var trans = SVG_IDX11_SVGRoot.currentTranslate;
   var scale = SVG_IDX11_SVGRoot.currentScale;
   SVG_IDX11_GetScaleFactors();
   var p1    = SVG_IDX11_SVGRoot.createSVGPoint();
   var p2;
      var m = SVG_IDX11_SVGRoot.getScreenCTM();
      if (navigator.userAgent.toLowerCase().indexOf("ipad") != -1) {
         p1.x = evt.clientX + window.pageXOffset;
         p1.y = evt.clientY + window.pageYOffset;
      }
      else {
      p1.x = evt.clientX;
      p1.y = evt.clientY;
      }
      p2 = p1.matrixTransform(m.inverse());
   SVG_IDX11_TrueCoords.x = Math.round(p2.x*100) / 100;
   SVG_IDX11_TrueCoords.y = Math.round(p2.y*100) / 100;
}
function SVG_IDX11_HideTooltip( evt )
{
   SVG_IDX11_tiptspan.firstChild.nodeValue = null;
   SVG_IDX11_singleTip.setAttributeNS(null, 'visibility', 'hidden');
}
function SVG_IDX11_ShowTooltip( evt )
{
   SVG_IDX11_GetTrueCoords( evt );
   var targetElement = evt.target;
   var tspanCount = targetElement.getElementsByTagName('desc').length;
   if (tspanCount == 1) {
      var targetTspan = targetElement.getElementsByTagName('desc').item(0);
      if ( targetTspan) {
         if (targetTspan.firstChild != null)
            SVG_IDX11_tiptspan.firstChild.nodeValue = targetTspan.firstChild.nodeValue; }
   }
   if ( '' != SVG_IDX11_tiptspan.firstChild.nodeValue )
   {
      var outline = SVG_IDX11_singleText.getBBox();
      SVG_IDX11_singleBox.setAttributeNS(null, 'transform', 'scale(' + SVG_IDX11_attrScale + ',' + SVG_IDX11_attrScale + ')' );
      SVG_IDX11_singleText.setAttributeNS(null, 'transform', 'scale(' + SVG_IDX11_attrScale + ',' + SVG_IDX11_attrScale + ')' );
      SVG_IDX11_singleTip.setAttributeNS(null, 'visibility', 'visible');
      if (evt.clientX + ((outline.width + 4)/0.47999) * SVG_IDX11_attrScale > SVG_IDX11_rightEdge) {
         var xPos = SVG_IDX11_TrueCoords.x - parseInt((outline.width + 4)*SVG_IDX11_attrScale);
         if (xPos < 0)
            xPos = 0;
      }
      else
         var xPos = SVG_IDX11_TrueCoords.x;
      if (SVG_IDX11_TrueCoords.y < 9) {
         var yPos = SVG_IDX11_TrueCoords.y + ((outline.height + 9)/0.47999)*SVG_IDX11_attrScale;
         if (yPos > windowHeight)
            yPos = SVG_IDX11_TrueCoords.y - parseInt((outline.height + 4)*SVG_IDX11_attrScale);
      }
      else
         var yPos = SVG_IDX11_TrueCoords.y - parseInt((outline.height + 4)*SVG_IDX11_attrScale);
      if (Number(outline.width == 0))
         SVG_IDX11_singleBox.setAttributeNS(null, 'width', outline.width);
      else
         SVG_IDX11_singleBox.setAttributeNS(null, 'width', outline.width + 4);
      SVG_IDX11_singleBox.setAttributeNS(null, 'height', outline.height + 4);
      SVG_IDX11_singleTip.setAttributeNS(null, 'transform', 'translate(' + xPos + ',' + yPos + ')');
   }
}

function SVG_IDX12_GetHW()
{

<script type="text/ecmascript">
var SVG_IDX13_SVGRoot = null;
var SVG_IDX13_TrueCoords = null;
var SVG_IDX13_singleTip = null;
var SVG_IDX13_singleBox = null;
var SVG_IDX13_singleText = null;
var SVG_IDX13_tiptspan = null;
var SVG_IDX13_attrScale = 1;
var SVG_IDX13_rightEdge = null;
var SVG_IDX13_SVGHeight = null;
var SVG_IDX13_SVGWidth = null;
function SVG_IDX13_Init(anchor) {
   SVG_IDX13_SVGRoot = document.getElementById(anchor);
   SVG_IDX13_TrueCoords = SVG_IDX13_SVGRoot.createSVGPoint();
   SVG_IDX13_singleTip = document.getElementById(anchor + '_singleTip1');
   SVG_IDX13_singleBox = document.getElementById(anchor + '_singleBox1');
   SVG_IDX13_singleText = document.getElementById(anchor + '_singleText1');
   SVG_IDX13_tiptspan = document.getElementById(anchor + '_tiptspan1');
   SVG_IDX13_tiptspan.firstChild.nodeValue = null;
   SVG_IDX13_SVGRoot.addEventListener('mousemove', SVG_IDX13_ShowTooltip, false);
   SVG_IDX13_SVGRoot.addEventListener('mouseout', SVG_IDX13_HideTooltip, false);
   SVG_IDX13_SVGHeight = SVG_IDX13_SVGRoot.getAttributeNS(null, "height");
   SVG_IDX13_SVGWidth = SVG_IDX13_SVGRoot.getAttributeNS(null, "width");
   if (!isNaN(parseFloat(SVG_IDX13_SVGHeight)) && !isNaN(parseFloat(SVG_IDX13_SVGWidth)))
      SVG_IDX13_GetHW();
}
function SVG_IDX13_GetHW()
{
    if (SVG_IDX13_SVGWidth != null && SVG_IDX13_SVGWidth != "") {
       if (SVG_IDX13_SVGWidth.match(/%/)) {
          var factor = parseFloat(SVG_IDX13_SVGWidth.replace(/%/,""))/100;
          SVG_IDX13_SVGWidth = window.innerWidth * factor;
       }
       else if (SVG_IDX13_SVGWidth.match(/in/))
          SVG_IDX13_SVGWidth = parseFloat(SVG_IDX13_SVGWidth.replace(/in/,""))*96;
       else if (SVG_IDX13_SVGWidth.match(/cm/))
          SVG_IDX13_SVGWidth = parseFloat(SVG_IDX13_SVGWidth.replace(/in/,""))*96/2.54;
       else
           SVG_IDX13_SVGWidth = parseFloat(SVG_IDX13_SVGWidth);
    }
    if (SVG_IDX13_SVGHeight != null && SVG_IDX13_SVGHeight != "") {
       if (SVG_IDX13_SVGHeight.match(/%/)) {
          var factor = parseFloat(SVG_IDX13_SVGHeight.replace(/%/,""))/100;
          SVG_IDX13_SVGHeight = window.innerHeight * factor;
       }
       else if (SVG_IDX13_SVGHeight.match(/in/))
          SVG_IDX13_SVGHeight = parseFloat(SVG_IDX13_SVGHeight.replace(/in/,""))*96;
       else if (SVG_IDX13_SVGHeight.match(/cm/))
          SVG_IDX13_SVGHeight = parseFloat(SVG_IDX13_SVGHeight.replace(/in/,""))*96/2.54;
       else
           SVG_IDX13_SVGHeight = parseFloat(SVG_IDX13_SVGHeight);
    }
}
function SVG_IDX13_GetScaleFactors(evt)
{
   var zoomFactor = 1;
   windowWidth  = (top.innerWidth==undefined)  ? window.innerWidth  : top.innerWidth;
   windowHeight = (top.innerHeight==undefined) ? window.innerHeight : top.innerHeight;
   SVG_IDX13_rightEdge = (SVG_IDX13_SVGWidth) ? SVG_IDX13_SVGWidth - window.pageXOffset : windowWidth;
   if (parseFloat(SVG_IDX13_SVGWidth) > 0 || parseFloat(SVG_IDX13_SVGHeight) > 0)
      var tipScale = 3.125;
   else {
      var tipXScale  = (screen.width/windowWidth) / SVG_IDX13_SVGRoot.currentScale;
      var tipYScale  = (screen.height/windowHeight) / SVG_IDX13_SVGRoot.currentScale;
      var tipScale   = (tipXScale + tipYScale)/2.0;
   }
   SVG_IDX13_attrScale = tipScale;
   if (navigator.appName == 'Adobe SVG Viewer') {
      if (screen.deviceXDPI != null && screen.logicalXDPI != null)
         zoomFactor = screen.deviceXDPI/screen.logicalXDPI;
      SVG_IDX13_attrScale = zoomFactor*tipScale;
   }
   else if (navigator.userAgent != null && navigator.userAgent != '') {
      var ua = navigator.userAgent.toLowerCase();
      if (ua.indexOf("msie") != -1 || ua.indexOf("trident") != -1) {
         zoomFactor = screen.deviceXDPI/screen.logicalXDPI;
         SVG_IDX13_attrScale = tipScale/zoomFactor;
         SVG_IDX13_rightEdge /= zoomFactor;
      }
      else if (ua.indexOf("ipad") != -1) {
         zoomFactor = SVG_IDX13_SVGRoot.clientWidth / window.innerWidth;
         SVG_IDX13_attrScale = 1.5 / zoomFactor;
         SVG_IDX13_rightEdge /= zoomFactor;
      }
      else if (ua.indexOf("opera") != -1)
         SVG_IDX13_attrScale = tipScale;
      else if (ua.indexOf("firefox") != -1)
         SVG_IDX13_attrScale = tipScale;
      else {
         if (SVG_IDX13_SVGWidth > 0 || SVG_IDX13_SVGHeight > 0)
            zoomFactor = 1;
         else
            zoomFactor = parseInt(document.defaultView.getComputedStyle(SVG_IDX13_SVGRoot, null).width,10)/
                                  SVG_IDX13_SVGRoot.clientWidth;
         SVG_IDX13_attrScale = tipScale/zoomFactor;
         SVG_IDX13_rightEdge *= zoomFactor;
      }
   }
}
function SVG_IDX13_GetTrueCoords(evt)
{
   var trans = SVG_IDX13_SVGRoot.currentTranslate;
   var scale = SVG_IDX13_SVGRoot.currentScale;
   SVG_IDX13_GetScaleFactors();
   var p1    = SVG_IDX13_SVGRoot.createSVGPoint();
   var p2;
      var m = SVG_IDX13_SVGRoot.getScreenCTM();
      if (navigator.userAgent.toLowerCase().indexOf("ipad") != -1) {
         p1.x = evt.clientX + window.pageXOffset;
         p1.y = evt.clientY + window.pageYOffset;
      }
      else {
      p1.x = evt.clientX;
      p1.y = evt.clientY;
      }
      p2 = p1.matrixTransform(m.inverse());
   SVG_IDX13_TrueCoords.x = Math.round(p2.x*100) / 100;
   SVG_IDX13_TrueCoords.y = Math.round(p2.y*100) / 100;
}
function SVG_IDX13_HideTooltip( evt )
{
   SVG_IDX13_tiptspan.firstChild.nodeValue = null;
   SVG_IDX13_singleTip.setAttributeNS(null, 'visibility', 'hidden');
}
function SVG_IDX13_ShowTooltip( evt )
{
   SVG_IDX13_GetTrueCoords( evt );
   var targetElement = evt.target;
   var tspanCount = targetElement.getElementsByTagName('desc').length;
   if (tspanCount == 1) {
      var targetTspan = targetElement.getElementsByTagName('desc').item(0);
      if ( targetTspan) {
         if (targetTspan.firstChild != null)
            SVG_IDX13_tiptspan.firstChild.nodeValue = targetTspan.firstChild.nodeValue; }
   }
   if ( '' != SVG_IDX13_tiptspan.firstChild.nodeValue )
   {
      var outline = SVG_IDX13_singleText.getBBox();
      SVG_IDX13_singleBox.setAttributeNS(null, 'transform', 'scale(' + SVG_IDX13_attrScale + ',' + SVG_IDX13_attrScale + ')' );
      SVG_IDX13_singleText.setAttributeNS(null, 'transform', 'scale(' + SVG_IDX13_attrScale + ',' + SVG_IDX13_attrScale + ')' );
      SVG_IDX13_singleTip.setAttributeNS(null, 'visibility', 'visible');
      if (evt.clientX + ((outline.width + 4)/0.47999) * SVG_IDX13_attrScale > SVG_IDX13_rightEdge) {
         var xPos = SVG_IDX13_TrueCoords.x - parseInt((outline.width + 4)*SVG_IDX13_attrScale);
         if (xPos < 0)
            xPos = 0;
      }
      else
         var xPos = SVG_IDX13_TrueCoords.x;
      if (SVG_IDX13_TrueCoords.y < 9) {
         var yPos = SVG_IDX13_TrueCoords.y + ((outline.height + 9)/0.47999)*SVG_IDX13_attrScale;
         if (yPos > windowHeight)
            yPos = SVG_IDX13_TrueCoords.y - parseInt((outline.height + 4)*SVG_IDX13_attrScale);
      }
      else
         var yPos = SVG_IDX13_TrueCoords.y - parseInt((outline.height + 4)*SVG_IDX13_attrScale);
      if (Number(outline.width == 0))
         SVG_IDX13_singleBox.setAttributeNS(null, 'width', outline.width);
      else
         SVG_IDX13_singleBox.setAttributeNS(null, 'width', outline.width + 4);
      SVG_IDX13_singleBox.setAttributeNS(null, 'height', outline.height + 4);
      SVG_IDX13_singleTip.setAttributeNS(null, 'transform', 'translate(' + xPos + ',' + yPos + ')');
   }
}

<script type="text/ecmascript">
var SVG_IDX14_SVGRoot = null;
var SVG_IDX14_TrueCoords = null;
var SVG_IDX14_singleTip = null;
var SVG_IDX14_singleBox = null;
var SVG_IDX14_singleText = null;
var SVG_IDX14_tiptspan = null;
var SVG_IDX14_attrScale = 1;
var SVG_IDX14_rightEdge = null;
var SVG_IDX14_SVGHeight = null;
var SVG_IDX14_SVGWidth = null;
function SVG_IDX14_Init(anchor) {
   SVG_IDX14_SVGRoot = document.getElementById(anchor);
   SVG_IDX14_TrueCoords = SVG_IDX14_SVGRoot.createSVGPoint();
   SVG_IDX14_singleTip = document.getElementById(anchor + '_singleTip1');
   SVG_IDX14_singleBox = document.getElementById(anchor + '_singleBox1');
   SVG_IDX14_singleText = document.getElementById(anchor + '_singleText1');
   SVG_IDX14_tiptspan = document.getElementById(anchor + '_tiptspan1');
   SVG_IDX14_tiptspan.firstChild.nodeValue = null;
   SVG_IDX14_SVGRoot.addEventListener('mousemove', SVG_IDX14_ShowTooltip, false);
   SVG_IDX14_SVGRoot.addEventListener('mouseout', SVG_IDX14_HideTooltip, false);
   SVG_IDX14_SVGHeight = SVG_IDX14_SVGRoot.getAttributeNS(null, "height");
   SVG_IDX14_SVGWidth = SVG_IDX14_SVGRoot.getAttributeNS(null, "width");
   if (!isNaN(parseFloat(SVG_IDX14_SVGHeight)) && !isNaN(parseFloat(SVG_IDX14_SVGWidth)))
      SVG_IDX14_GetHW();
}
function SVG_IDX14_GetHW()
{
    if (SVG_IDX14_SVGWidth != null && SVG_IDX14_SVGWidth != "") {
       if (SVG_IDX14_SVGWidth.match(/%/)) {
          var factor = parseFloat(SVG_IDX14_SVGWidth.replace(/%/,""))/100;
          SVG_IDX14_SVGWidth = window.innerWidth * factor;
       }
       else if (SVG_IDX14_SVGWidth.match(/in/))
          SVG_IDX14_SVGWidth = parseFloat(SVG_IDX14_SVGWidth.replace(/in/,""))*96;
       else if (SVG_IDX14_SVGWidth.match(/cm/))
          SVG_IDX14_SVGWidth = parseFloat(SVG_IDX14_SVGWidth.replace(/in/,""))*96/2.54;
       else
           SVG_IDX14_SVGWidth = parseFloat(SVG_IDX14_SVGWidth);
    }
    if (SVG_IDX14_SVGHeight != null && SVG_IDX14_SVGHeight != "") {
       if (SVG_IDX14_SVGHeight.match(/%/)) {
          var factor = parseFloat(SVG_IDX14_SVGHeight.replace(/%/,""))/100;
          SVG_IDX14_SVGHeight = window.innerHeight * factor;
       }
       else if (SVG_IDX14_SVGHeight.match(/in/))
          SVG_IDX14_SVGHeight = parseFloat(SVG_IDX14_SVGHeight.replace(/in/,""))*96;
       else if (SVG_IDX14_SVGHeight.match(/cm/))
          SVG_IDX14_SVGHeight = parseFloat(SVG_IDX14_SVGHeight.replace(/in/,""))*96/2.54;
       else
           SVG_IDX14_SVGHeight = parseFloat(SVG_IDX14_SVGHeight);
    }
}
function SVG_IDX14_GetScaleFactors(evt)
{
   var zoomFactor = 1;
   windowWidth  = (top.innerWidth==undefined)  ? window.innerWidth  : top.innerWidth;
   windowHeight = (top.innerHeight==undefined) ? window.innerHeight : top.innerHeight;
   SVG_IDX14_rightEdge = (SVG_IDX14_SVGWidth) ? SVG_IDX14_SVGWidth - window.pageXOffset : windowWidth;
   if (parseFloat(SVG_IDX14_SVGWidth) > 0 || parseFloat(SVG_IDX14_SVGHeight) > 0)
      var tipScale = 3.125;
   else {
      var tipXScale  = (screen.width/windowWidth) / SVG_IDX14_SVGRoot.currentScale;
      var tipYScale  = (screen.height/windowHeight) / SVG_IDX14_SVGRoot.currentScale;
      var tipScale   = (tipXScale + tipYScale)/2.0;
   }
   SVG_IDX14_attrScale = tipScale;
   if (navigator.appName == 'Adobe SVG Viewer') {
      if (screen.deviceXDPI != null && screen.logicalXDPI != null)
         zoomFactor = screen.deviceXDPI/screen.logicalXDPI;
      SVG_IDX14_attrScale = zoomFactor*tipScale;
   }
   else if (navigator.userAgent != null && navigator.userAgent != '') {
      var ua = navigator.userAgent.toLowerCase();
      if (ua.indexOf("msie") != -1 || ua.indexOf("trident") != -1) {
         zoomFactor = screen.deviceXDPI/screen.logicalXDPI;
         SVG_IDX14_attrScale = tipScale/zoomFactor;
         SVG_IDX14_rightEdge /= zoomFactor;
      }
      else if (ua.indexOf("ipad") != -1) {
         zoomFactor = SVG_IDX14_SVGRoot.clientWidth / window.innerWidth;
         SVG_IDX14_attrScale = 1.5 / zoomFactor;
         SVG_IDX14_rightEdge /= zoomFactor;
      }
      else if (ua.indexOf("opera") != -1)
         SVG_IDX14_attrScale = tipScale;
      else if (ua.indexOf("firefox") != -1)
         SVG_IDX14_attrScale = tipScale;
      else {
         if (SVG_IDX14_SVGWidth > 0 || SVG_IDX14_SVGHeight > 0)
            zoomFactor = 1;
         else
            zoomFactor = parseInt(document.defaultView.getComputedStyle(SVG_IDX14_SVGRoot, null).width,10)/
                                  SVG_IDX14_SVGRoot.clientWidth;
         SVG_IDX14_attrScale = tipScale/zoomFactor;
         SVG_IDX14_rightEdge *= zoomFactor;
      }
   }
}
function SVG_IDX14_GetTrueCoords(evt)
{
   var trans = SVG_IDX14_SVGRoot.currentTranslate;
   var scale = SVG_IDX14_SVGRoot.currentScale;
   SVG_IDX14_GetScaleFactors();
   var p1    = SVG_IDX14_SVGRoot.createSVGPoint();
   var p2;
      var m = SVG_IDX14_SVGRoot.getScreenCTM();
      if (navigator.userAgent.toLowerCase().indexOf("ipad") != -1) {
         p1.x = evt.clientX + window.pageXOffset;
         p1.y = evt.clientY + window.pageYOffset;
      }
      else {
      p1.x = evt.clientX;
      p1.y = evt.clientY;
      }
      p2 = p1.matrixTransform(m.inverse());
   SVG_IDX14_TrueCoords.x = Math.round(p2.x*100) / 100;
   SVG_IDX14_TrueCoords.y = Math.round(p2.y*100) / 100;
}
function SVG_IDX14_HideTooltip( evt )
{
   SVG_IDX14_tiptspan.firstChild.nodeValue = null;
   SVG_IDX14_singleTip.setAttributeNS(null, 'visibility', 'hidden');
}
function SVG_IDX14_ShowTooltip( evt )
{
   SVG_IDX14_GetTrueCoords( evt );
   var targetElement = evt.target;
   var tspanCount = targetElement.getElementsByTagName('desc').length;
   if (tspanCount == 1) {
      var targetTspan = targetElement.getElementsByTagName('desc').item(0);
      if ( targetTspan) {
         if (targetTspan.firstChild != null)
            SVG_IDX14_tiptspan.firstChild.nodeValue = targetTspan.firstChild.nodeValue; }
   }
   if ( '' != SVG_IDX14_tiptspan.firstChild.nodeValue )
   {
      var outline = SVG_IDX14_singleText.getBBox();
      SVG_IDX14_singleBox.setAttributeNS(null, 'transform', 'scale(' + SVG_IDX14_attrScale + ',' + SVG_IDX14_attrScale + ')' );
      SVG_IDX14_singleText.setAttributeNS(null, 'transform', 'scale(' + SVG_IDX14_attrScale + ',' + SVG_IDX14_attrScale + ')' );
      SVG_IDX14_singleTip.setAttributeNS(null, 'visibility', 'visible');
      if (evt.clientX + ((outline.width + 4)/0.47999) * SVG_IDX14_attrScale > SVG_IDX14_rightEdge) {
         var xPos = SVG_IDX14_TrueCoords.x - parseInt((outline.width + 4)*SVG_IDX14_attrScale);
         if (xPos < 0)
            xPos = 0;
      }
      else
         var xPos = SVG_IDX14_TrueCoords.x;
      if (SVG_IDX14_TrueCoords.y < 9) {
         var yPos = SVG_IDX14_TrueCoords.y + ((outline.height + 9)/0.47999)*SVG_IDX14_attrScale;
         if (yPos > windowHeight)
            yPos = SVG_IDX14_TrueCoords.y - parseInt((outline.height + 4)*SVG_IDX14_attrScale);
      }
      else
         var yPos = SVG_IDX14_TrueCoords.y - parseInt((outline.height + 4)*SVG_IDX14_attrScale);
      if (Number(outline.width == 0))
         SVG_IDX14_singleBox.setAttributeNS(null, 'width', outline.width);
      else
         SVG_IDX14_singleBox.setAttributeNS(null, 'width', outline.width + 4);
      SVG_IDX14_singleBox.setAttributeNS(null, 'height', outline.height + 4);
      SVG_IDX14_singleTip.setAttributeNS(null, 'transform', 'translate(' + xPos + ',' + yPos + ')');
   }
}
</script>

<script type="text/ecmascript">
var SVG_IDX15_SVGRoot = null;
var SVG_IDX15_TrueCoords = null;
var SVG_IDX15_singleTip = null;
var SVG_IDX15_singleBox = null;
var SVG_IDX15_singleText = null;
var SVG_IDX15_tiptspan = null;
var SVG_IDX15_attrScale = 1;
var SVG_IDX15_rightEdge = null;
var SVG_IDX15_SVGHeight = null;
var SVG_IDX15_SVGWidth = null;
function SVG_IDX15_Init(anchor) {
   SVG_IDX15_SVGRoot = document.getElementById(anchor);
   SVG_IDX15_TrueCoords = SVG_IDX15_SVGRoot.createSVGPoint();
   SVG_IDX15_singleTip = document.getElementById(anchor + '_singleTip1');
   SVG_IDX15_singleBox = document.getElementById(anchor + '_singleBox1');
   SVG_IDX15_singleText = document.getElementById(anchor + '_singleText1');
   SVG_IDX15_tiptspan = document.getElementById(anchor + '_tiptspan1');
   SVG_IDX15_tiptspan.firstChild.nodeValue = null;
   SVG_IDX15_SVGRoot.addEventListener('mousemove', SVG_IDX15_ShowTooltip, false);
   SVG_IDX15_SVGRoot.addEventListener('mouseout', SVG_IDX15_HideTooltip, false);
   SVG_IDX15_SVGHeight = SVG_IDX15_SVGRoot.getAttributeNS(null, "height");
   SVG_IDX15_SVGWidth = SVG_IDX15_SVGRoot.getAttributeNS(null, "width");
   if (!isNaN(parseFloat(SVG_IDX15_SVGHeight)) && !isNaN(parseFloat(SVG_IDX15_SVGWidth)))
      SVG_IDX15_GetHW();
}
function SVG_IDX15_GetHW()
{
    if (SVG_IDX15_SVGWidth != null && SVG_IDX15_SVGWidth != "") {
       if (SVG_IDX15_SVGWidth.match(/%/)) {
          var factor = parseFloat(SVG_IDX15_SVGWidth.replace(/%/,""))/100;
          SVG_IDX15_SVGWidth = window.innerWidth * factor;
       }
       else if (SVG_IDX15_SVGWidth.match(/in/))
          SVG_IDX15_SVGWidth = parseFloat(SVG_IDX15_SVGWidth.replace(/in/,""))*96;
       else if (SVG_IDX15_SVGWidth.match(/cm/))
          SVG_IDX15_SVGWidth = parseFloat(SVG_IDX15_SVGWidth.replace(/in/,""))*96/2.54;
       else
           SVG_IDX15_SVGWidth = parseFloat(SVG_IDX15_SVGWidth);
    }
    if (SVG_IDX15_SVGHeight != null && SVG_IDX15_SVGHeight != "") {
       if (SVG_IDX15_SVGHeight.match(/%/)) {
          var factor = parseFloat(SVG_IDX15_SVGHeight.replace(/%/,""))/100;
          SVG_IDX15_SVGHeight = window.innerHeight * factor;
       }
       else if (SVG_IDX15_SVGHeight.match(/in/))
          SVG_IDX15_SVGHeight = parseFloat(SVG_IDX15_SVGHeight.replace(/in/,""))*96;
       else if (SVG_IDX15_SVGHeight.match(/cm/))
          SVG_IDX15_SVGHeight = parseFloat(SVG_IDX15_SVGHeight.replace(/in/,""))*96/2.54;
       else
           SVG_IDX15_SVGHeight = parseFloat(SVG_IDX15_SVGHeight);
    }
}
function SVG_IDX15_GetScaleFactors(evt)
{
   var zoomFactor = 1;
   windowWidth  = (top.innerWidth==undefined)  ? window.innerWidth  : top.innerWidth;
   windowHeight = (top.innerHeight==undefined) ? window.innerHeight : top.innerHeight;
   SVG_IDX15_rightEdge = (SVG_IDX15_SVGWidth) ? SVG_IDX15_SVGWidth - window.pageXOffset : windowWidth;
   if (parseFloat(SVG_IDX15_SVGWidth) > 0 || parseFloat(SVG_IDX15_SVGHeight) > 0)
      var tipScale = 3.125;
   else {
      var tipXScale  = (screen.width/windowWidth) / SVG_IDX15_SVGRoot.currentScale;
      var tipYScale  = (screen.height/windowHeight) / SVG_IDX15_SVGRoot.currentScale;
      var tipScale   = (tipXScale + tipYScale)/2.0;
   }
   SVG_IDX15_attrScale = tipScale;
   if (navigator.appName == 'Adobe SVG Viewer') {
      if (screen.deviceXDPI != null && screen.logicalXDPI != null)
         zoomFactor = screen.deviceXDPI/screen.logicalXDPI;
      SVG_IDX15_attrScale = zoomFactor*tipScale;
   }
   else if (navigator.userAgent != null && navigator.userAgent != '') {
      var ua = navigator.userAgent.toLowerCase();
      if (ua.indexOf("msie") != -1 || ua.indexOf("trident") != -1) {
         zoomFactor = screen.deviceXDPI/screen.logicalXDPI;
         SVG_IDX15_attrScale = tipScale/zoomFactor;
         SVG_IDX15_rightEdge /= zoomFactor;
      }
      else if (ua.indexOf("ipad") != -1) {
         zoomFactor = SVG_IDX15_SVGRoot.clientWidth / window.innerWidth;
         SVG_IDX15_attrScale = 1.5 / zoomFactor;
         SVG_IDX15_rightEdge /= zoomFactor;
      }
      else if (ua.indexOf("opera") != -1)
         SVG_IDX15_attrScale = tipScale;
      else if (ua.indexOf("firefox") != -1)
         SVG_IDX15_attrScale = tipScale;
      else {
         if (SVG_IDX15_SVGWidth > 0 || SVG_IDX15_SVGHeight > 0)
            zoomFactor = 1;
         else
            zoomFactor = parseInt(document.defaultView.getComputedStyle(SVG_IDX15_SVGRoot, null).width,10)/
                                  SVG_IDX15_SVGRoot.clientWidth;
         SVG_IDX15_attrScale = tipScale/zoomFactor;
         SVG_IDX15_rightEdge *= zoomFactor;
      }
   }
}
function SVG_IDX15_GetTrueCoords(evt)
{
   var trans = SVG_IDX15_SVGRoot.currentTranslate;
   var scale = SVG_IDX15_SVGRoot.currentScale;
   SVG_IDX15_GetScaleFactors();
   var p1    = SVG_IDX15_SVGRoot.createSVGPoint();
   var p2;
      var m = SVG_IDX15_SVGRoot.getScreenCTM();
      if (navigator.userAgent.toLowerCase().indexOf("ipad") != -1) {
         p1.x = evt.clientX + window.pageXOffset;
         p1.y = evt.clientY + window.pageYOffset;
      }
      else {
      p1.x = evt.clientX;
      p1.y = evt.clientY;
      }
      p2 = p1.matrixTransform(m.inverse());
   SVG_IDX15_TrueCoords.x = Math.round(p2.x*100) / 100;
   SVG_IDX15_TrueCoords.y = Math.round(p2.y*100) / 100;
}
function SVG_IDX15_HideTooltip( evt )
{
   SVG_IDX15_tiptspan.firstChild.nodeValue = null;
   SVG_IDX15_singleTip.setAttributeNS(null, 'visibility', 'hidden');
}
function SVG_IDX15_ShowTooltip( evt )
{
   SVG_IDX15_GetTrueCoords( evt );
   var targetElement = evt.target;
   var tspanCount = targetElement.getElementsByTagName('desc').length;
   if (tspanCount == 1) {
      var targetTspan = targetElement.getElementsByTagName('desc').item(0);
      if ( targetTspan) {
         if (targetTspan.firstChild != null)
            SVG_IDX15_tiptspan.firstChild.nodeValue = targetTspan.firstChild.nodeValue; }
   }
   if ( '' != SVG_IDX15_tiptspan.firstChild.nodeValue )
   {
      var outline = SVG_IDX15_singleText.getBBox();
      SVG_IDX15_singleBox.setAttributeNS(null, 'transform', 'scale(' + SVG_IDX15_attrScale + ',' + SVG_IDX15_attrScale + ')' );
      SVG_IDX15_singleText.setAttributeNS(null, 'transform', 'scale(' + SVG_IDX15_attrScale + ',' + SVG_IDX15_attrScale + ')' );
      SVG_IDX15_singleTip.setAttributeNS(null, 'visibility', 'visible');
      if (evt.clientX + ((outline.width + 4)/0.47999) * SVG_IDX15_attrScale > SVG_IDX15_rightEdge) {
         var xPos = SVG_IDX15_TrueCoords.x - parseInt((outline.width + 4)*SVG_IDX15_attrScale);
         if (xPos < 0)
            xPos = 0;
      }
      else
         var xPos = SVG_IDX15_TrueCoords.x;
      if (SVG_IDX15_TrueCoords.y < 9) {
         var yPos = SVG_IDX15_TrueCoords.y + ((outline.height + 9)/0.47999)*SVG_IDX15_attrScale;
         if (yPos > windowHeight)
            yPos = SVG_IDX15_TrueCoords.y - parseInt((outline.height + 4)*SVG_IDX15_attrScale);
      }
      else
         var yPos = SVG_IDX15_TrueCoords.y - parseInt((outline.height + 4)*SVG_IDX15_attrScale);
      if (Number(outline.width == 0))
         SVG_IDX15_singleBox.setAttributeNS(null, 'width', outline.width);
      else
         SVG_IDX15_singleBox.setAttributeNS(null, 'width', outline.width + 4);
      SVG_IDX15_singleBox.setAttributeNS(null, 'height', outline.height + 4);
      SVG_IDX15_singleTip.setAttributeNS(null, 'transform', 'translate(' + xPos + ',' + yPos + ')');
   }

<script type="text/ecmascript">
var SVG_IDX16_SVGRoot = null;

var SVG_IDX16_singleBox = null;

var SVG_IDX16_rightEdge = null;
var SVG_IDX16_SVGHeight = null;
var SVG_IDX16_SVGWidth = null;
function SVG_IDX16_Init(anchor) {
   SVG_IDX16_SVGRoot = document.getElementById(anchor);
   SVG_IDX16_TrueCoords = SVG_IDX16_SVGRoot.createSVGPoint();
   SVG_IDX16_singleTip = document.getElementById(anchor + '_singleTip1');
   SVG_IDX16_singleBox = document.getElementById(anchor + '_singleBox1');
   SVG_IDX16_singleText = document.getElementById(anchor + '_singleText1');
   SVG_IDX16_tiptspan = document.getElementById(anchor + '_tiptspan1');
   SVG_IDX16_tiptspan.firstChild.nodeValue = null;
   SVG_IDX16_SVGRoot.addEventListener('mousemove', SVG_IDX16_ShowTooltip, false);
   SVG_IDX16_SVGRoot.addEventListener('mouseout', SVG_IDX16_HideTooltip, false);
   SVG_IDX16_SVGHeight = SVG_IDX16_SVGRoot.getAttributeNS(null, "height");
   SVG_IDX16_SVGWidth = SVG_IDX16_SVGRoot.getAttributeNS(null, "width");
   if (!isNaN(parseFloat(SVG_IDX16_SVGHeight)) && !isNaN(parseFloat(SVG_IDX16_SVGWidth)))
      SVG_IDX16_GetHW();
}
function SVG_IDX16_GetHW()
{
    if (SVG_IDX16_SVGWidth != null && SVG_IDX16_SVGWidth != "") {
       if (SVG_IDX16_SVGWidth.match(/%/)) {
          var factor = parseFloat(SVG_IDX16_SVGWidth.replace(/%/,""))/100;
          SVG_IDX16_SVGWidth = window.innerWidth * factor;
       }
       else if (SVG_IDX16_SVGWidth.match(/in/))
          SVG_IDX16_SVGWidth = parseFloat(SVG_IDX16_SVGWidth.replace(/in/,""))*96;
       else if (SVG_IDX16_SVGWidth.match(/cm/))
          SVG_IDX16_SVGWidth = parseFloat(SVG_IDX16_SVGWidth.replace(/in/,""))*96/2.54;
       else
           SVG_IDX16_SVGWidth = parseFloat(SVG_IDX16_SVGWidth);
    }
    if (SVG_IDX16_SVGHeight != null && SVG_IDX16_SVGHeight != "") {
       if (SVG_IDX16_SVGHeight.match(/%/)) {
          var factor = parseFloat(SVG_IDX16_SVGHeight.replace(/%/,""))/100;
          SVG_IDX16_SVGHeight = window.innerHeight * factor;
       }
       else if (SVG_IDX16_SVGHeight.match(/in/))
          SVG_IDX16_SVGHeight = parseFloat(SVG_IDX16_SVGHeight.replace(/in/,""))*96;
       else if (SVG_IDX16_SVGHeight.match(/cm/))
          SVG_IDX16_SVGHeight = parseFloat(SVG_IDX16_SVGHeight.replace(/in/,""))*96/2.54;
       else
           SVG_IDX16_SVGHeight = parseFloat(SVG_IDX16_SVGHeight);
    }
}
function SVG_IDX16_GetScaleFactors(evt)
{
   var zoomFactor = 1;
   windowWidth  = (top.innerWidth==undefined)  ? window.innerWidth  : top.innerWidth;
   windowHeight = (top.innerHeight==undefined) ? window.innerHeight : top.innerHeight;
   SVG_IDX16_rightEdge = (SVG_IDX16_SVGWidth) ? SVG_IDX16_SVGWidth - window.pageXOffset : windowWidth;
   if (parseFloat(SVG_IDX16_SVGWidth) > 0 || parseFloat(SVG_IDX16_SVGHeight) > 0)
      var tipScale = 3.125;
   else {
      var tipXScale  = (screen.width/windowWidth) / SVG_IDX16_SVGRoot.currentScale;
      var tipYScale  = (screen.height/windowHeight) / SVG_IDX16_SVGRoot.currentScale;
      var tipScale   = (tipXScale + tipYScale)/2.0;
   }
   SVG_IDX16_attrScale = tipScale;
   if (navigator.appName == 'Adobe SVG Viewer') {
      if (screen.deviceXDPI != null && screen.logicalXDPI != null)
         zoomFactor = screen.deviceXDPI/screen.logicalXDPI;
      SVG_IDX16_attrScale = zoomFactor*tipScale;
   }
   else if (navigator.userAgent != null && navigator.userAgent != '') {
      var ua = navigator.userAgent.toLowerCase();
      if (ua.indexOf("msie") != -1 || ua.indexOf("trident") != -1) {
         zoomFactor = screen.deviceXDPI/screen.logicalXDPI;
         SVG_IDX16_attrScale = tipScale/zoomFactor;
         SVG_IDX16_rightEdge /= zoomFactor;
      }
      else if (ua.indexOf("ipad") != -1) {
         zoomFactor = SVG_IDX16_SVGRoot.clientWidth / window.innerWidth;
         SVG_IDX16_attrScale = 1.5 / zoomFactor;
         SVG_IDX16_rightEdge /= zoomFactor;
      }
      else if (ua.indexOf("opera") != -1)
         SVG_IDX16_attrScale = tipScale;
      else if (ua.indexOf("firefox") != -1)
         SVG_IDX16_attrScale = tipScale;
      else {
         if (SVG_IDX16_SVGWidth > 0 || SVG_IDX16_SVGHeight > 0)
            zoomFactor = 1;
         else
            zoomFactor = parseInt(document.defaultView.getComputedStyle(SVG_IDX16_SVGRoot, null).width,10)/
                                  SVG_IDX16_SVGRoot.clientWidth;
         SVG_IDX16_attrScale = tipScale/zoomFactor;
         SVG_IDX16_rightEdge *= zoomFactor;
      }
   }
}
function SVG_IDX16_GetTrueCoords(evt)
{
   var trans = SVG_IDX16_SVGRoot.currentTranslate;
   var scale = SVG_IDX16_SVGRoot.currentScale;
   SVG_IDX16_GetScaleFactors();
   var p1    = SVG_IDX16_SVGRoot.createSVGPoint();
   var p2;
      var m = SVG_IDX16_SVGRoot.getScreenCTM();
      if (navigator.userAgent.toLowerCase().indexOf("ipad") != -1) {
         p1.x = evt.clientX + window.pageXOffset;
         p1.y = evt.clientY + window.pageYOffset;
      }
      else {
      p1.x = evt.clientX;
      p1.y = evt.clientY;
      }
      p2 = p1.matrixTransform(m.inverse());
   SVG_IDX16_TrueCoords.x = Math.round(p2.x*100) / 100;
   SVG_IDX16_TrueCoords.y = Math.round(p2.y*100) / 100;
}
function SVG_IDX16_HideTooltip( evt )
{
   SVG_IDX16_tiptspan.firstChild.nodeValue = null;
   SVG_IDX16_singleTip.setAttributeNS(null, 'visibility', 'hidden');
}
function SVG_IDX16_ShowTooltip( evt )
{
   SVG_IDX16_GetTrueCoords( evt );
   var targetElement = evt.target;
   var tspanCount = targetElement.getElementsByTagName('desc').length;
   if (tspanCount == 1) {
      var targetTspan = targetElement.getElementsByTagName('desc').item(0);
      if ( targetTspan) {
         if (targetTspan.firstChild != null)
            SVG_IDX16_tiptspan.firstChild.nodeValue = targetTspan.firstChild.nodeValue; }
   }
   if ( '' != SVG_IDX16_tiptspan.firstChild.nodeValue )
   {
      var outline = SVG_IDX16_singleText.getBBox();
      SVG_IDX16_singleBox.setAttributeNS(null, 'transform', 'scale(' + SVG_IDX16_attrScale + ',' + SVG_IDX16_attrScale + ')' );
      SVG_IDX16_singleText.setAttributeNS(null, 'transform', 'scale(' + SVG_IDX16_attrScale + ',' + SVG_IDX16_attrScale + ')' );
      SVG_IDX16_singleTip.setAttributeNS(null, 'visibility', 'visible');
      if (evt.clientX + ((outline.width + 4)/0.47999) * SVG_IDX16_attrScale > SVG_IDX16_rightEdge) {
         var xPos = SVG_IDX16_TrueCoords.x - parseInt((outline.width + 4)*SVG_IDX16_attrScale);
         if (xPos < 0)
            xPos = 0;
      }
      else
         var xPos = SVG_IDX16_TrueCoords.x;
      if (SVG_IDX16_TrueCoords.y < 9) {
         var yPos = SVG_IDX16_TrueCoords.y + ((outline.height + 9)/0.47999)*SVG_IDX16_attrScale;
         if (yPos > windowHeight)
            yPos = SVG_IDX16_TrueCoords.y - parseInt((outline.height + 4)*SVG_IDX16_attrScale);
      }
      else
         var yPos = SVG_IDX16_TrueCoords.y - parseInt((outline.height + 4)*SVG_IDX16_attrScale);
      if (Number(outline.width == 0))
         SVG_IDX16_singleBox.setAttributeNS(null, 'width', outline.width);
      else
         SVG_IDX16_singleBox.setAttributeNS(null, 'width', outline.width + 4);
      SVG_IDX16_singleBox.setAttributeNS(null, 'height', outline.height + 4);
      SVG_IDX16_singleTip.setAttributeNS(null, 'transform', 'translate(' + xPos + ',' + yPos + ')');
   }
}
